import React, { useState, useEffect } from 'react';
import {
  Box,
  Button,
  Card,
  CardContent,
  Typography,
  TextField,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Grid,
  MenuItem,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
} from '@mui/material';
import { format } from 'date-fns';
import axios from 'axios';

function TimeEntries() {
  const [timeEntries, setTimeEntries] = useState([]);
  const [projects, setProjects] = useState([]);
  const [open, setOpen] = useState(false);
  const [newEntry, setNewEntry] = useState({
    project_id: '',
    start_time: '',
    end_time: '',
    description: '',
  });

  useEffect(() => {
    fetchTimeEntries();
    fetchProjects();
  }, []);

  const fetchTimeEntries = async () => {
    try {
      const response = await axios.get('http://localhost:3001/api/time-entries');
      setTimeEntries(response.data);
    } catch (error) {
      console.error('Error fetching time entries:', error);
    }
  };

  const fetchProjects = async () => {
    try {
      const response = await axios.get('http://localhost:3001/api/projects');
      setProjects(response.data);
    } catch (error) {
      console.error('Error fetching projects:', error);
    }
  };

  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const handleSubmit = async () => {
    try {
      await axios.post('http://localhost:3001/api/time-entries', newEntry);
      fetchTimeEntries();
      handleClose();
      setNewEntry({
        project_id: '',
        start_time: '',
        end_time: '',
        description: '',
      });
    } catch (error) {
      console.error('Error creating time entry:', error);
    }
  };

  const getProjectName = (projectId) => {
    const project = projects.find((p) => p.id === projectId);
    return project ? project.name : 'Unknown Project';
  };

  return (
    <Box>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 3 }}>
        <Typography variant="h4">Time Entries</Typography>
        <Button variant="contained" color="primary" onClick={handleOpen}>
          Add Time Entry
        </Button>
      </Box>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Project</TableCell>
              <TableCell>Start Time</TableCell>
              <TableCell>End Time</TableCell>
              <TableCell>Description</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {timeEntries.map((entry) => (
              <TableRow key={entry.id}>
                <TableCell>{getProjectName(entry.project_id)}</TableCell>
                <TableCell>
                  {format(new Date(entry.start_time), 'PPpp')}
                </TableCell>
                <TableCell>
                  {format(new Date(entry.end_time), 'PPpp')}
                </TableCell>
                <TableCell>{entry.description}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Add Time Entry</DialogTitle>
        <DialogContent>
          <TextField
            select
            fullWidth
            margin="dense"
            label="Project"
            value={newEntry.project_id}
            onChange={(e) => setNewEntry({ ...newEntry, project_id: e.target.value })}
          >
            {projects.map((project) => (
              <MenuItem key={project.id} value={project.id}>
                {project.name}
              </MenuItem>
            ))}
          </TextField>
          <TextField
            fullWidth
            margin="dense"
            label="Start Time"
            type="datetime-local"
            value={newEntry.start_time}
            onChange={(e) => setNewEntry({ ...newEntry, start_time: e.target.value })}
            InputLabelProps={{
              shrink: true,
            }}
          />
          <TextField
            fullWidth
            margin="dense"
            label="End Time"
            type="datetime-local"
            value={newEntry.end_time}
            onChange={(e) => setNewEntry({ ...newEntry, end_time: e.target.value })}
            InputLabelProps={{
              shrink: true,
            }}
          />
          <TextField
            fullWidth
            margin="dense"
            label="Description"
            multiline
            rows={4}
            value={newEntry.description}
            onChange={(e) => setNewEntry({ ...newEntry, description: e.target.value })}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSubmit} variant="contained" color="primary">
            Add Entry
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
}

export default TimeEntries;
